import React from "react";

const SearchBar = () => {
  return (
    <div id="Tab-bar">
      <div className="Search1">
        <section className="search-button">
          <input type="text" id="input" placeholder="Search..." />
          <button type="button">
            <i className="fa fa-search"></i>
          </button>
        </section>
      </div>
      <div className="mainbuttons">
        <button className="b1" onClick={openHome}>Home</button>
        <button className="b1" onClick={openAbout}>About</button>
        <button className="b1" onClick={openTravel}>Travel</button>
        <button className="b1" onClick={openRelax}>Relax</button>
        <button className="b1" onClick={openEat}>Eat</button>
      </div>
      <div className="social-icons">
        <button className="b2" onClick={openInstagram}><i className="fa fa-instagram"></i></button>
        <button className="b2" onClick={openPinterest}><i className="fa fa-pinterest"></i></button>
        <button className="b2" onClick={openFacebook}><i className="fa fa-facebook"></i></button>
        <button className="b2" onClick={openTwitter}><i className="fa fa-twitter"></i></button>
      </div>
    </div>
  );
};

// Placeholder functions for each button
function openHome() { /* Logic for Home */ }
function openAbout() { /* Logic for About */ }
function openTravel() { /* Logic for Travel */ }
function openRelax() { /* Logic for Relax */ }
function openEat() { /* Logic for Eat */ }
function openInstagram() { /* Logic for Instagram */ }
function openPinterest() { /* Logic for Pinterest */ }
function openFacebook() { /* Logic for Facebook */ }
function openTwitter() { /* Logic for Twitter */ }

export default SearchBar;
